function checkForPrime(arr) {
  for (let i = 0; i < arr.length; i++) {
    if (arr[i] <= 1) {
      console.log("This is a prime number:", arr[i]);
      break;
    } else if (arr[i] <= 3) {
      console.log("This is a prime number:", arr[i]);
    } else if (arr[i] % 2 == 0 || arr[i] % 3 == 0) {
      console.log("This is not a prime number:", arr[i]);
    } else {
      for (let j = 5; j * j <= arr[i]; j = j + 6) {
        if (arr[i] % j == 0) {
          console.log("This is not a prime number:", arr[i]);
          break;
        }
      }
    }
  }
}
